import React from "react";
import Slider from "react-slick";

// css 
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import Collection from "../HomePage/CollectionComp";
import "./Styles/SliderStyle.css";

function CollectionSlider(props) {
  const settings = {
    className: "center",
    infinite: false,
    centerPadding: "0px",
    slidesToShow: 2.17,
    swipeToSlide: true,
    arrows: false,
    afterChange: function(index) {
      console.log(
        `Slider Changed to: ${index + 1}, background: #222; color: #bada55`
      );
    }
  };
  let values = props.val;
    return (
      <div>
        <h2 className="SliderHeader">Trending Collection</h2>
        <Slider {...settings}>
          {values.map((item,index)=>{
            return <div key={index}><Collection img={item.image} title={item.title} /></div>;
          })}

        </Slider>
      </div>
    );
  }

export default CollectionSlider;
